import React from "react";
import AnimatedStats from "./AnimatedStats";

const Skills = () => {
  return (
    <section id="skills" className="bg-black text-white py-16">
      <div className="container mx-auto">
        <h2 className="text-3xl font-bold mb-8">My Skills</h2>

        {/* Add other skill sections here */}
        <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
          {/* Example Skills */}
          <div className="bg-gray-800 p-4 rounded-md text-center">
            <p className="text-xl font-semibold">JavaScript</p>
            <p className="text-sm text-gray-400">3+ years</p>
          </div>
          <div className="bg-gray-800 p-4 rounded-md text-center">
            <p className="text-xl font-semibold">React</p>
            <p className="text-sm text-gray-400">2+ years</p>
          </div>
          {/* Add more skills as needed */}
        </div>

        {/* Animated Stats */}
        <div className="mt-12">
          <AnimatedStats />
        </div>
      </div>
    </section>
  );
};

export default Skills;
